                        <ContentContainer>
                            <Fade delay={200}>
                                <ContentHead data={contentHeadData.travel} />
                            </Fade>
                            <Fade delay={200}>
                                <BoxCategories data={travelData} />
                            </Fade>

                        </ContentContainer>
                    </section>
                </ContentLayout>
                <style jsx>{`
                    .travelHero {
                        background-image: url('/static/images/hero/travel.png');
                        height: 600px;
                    }
                `}</style>
            </div>
        )
    }
}
export default Krabi;
